import React from 'react'
import { Link } from 'react-router-dom'

export const Navbar = () => {
  return (
    <div className="navbar container">
      <Link to="/" className="logo">QL Thong Tin Ca Nhan</Link>
      <Link to="/dang-nhap" className="login-button">Dang nhap</Link>
    </div>
  )
}
